import React from "react";
import { Route, Switch } from "react-router-dom";
import routes from "../routes.js";

class Auth extends React.Component {
  componentDidMount() {
    document.body.classList.add("kt-quick-panel--right kt-demo-panel--right kt-offcanvas-panel--right kt-header--fixed kt-header-mobile--fixed kt-subheader--enabled kt-subheader--fixed kt-subheader--solid kt-aside--enabled kt-aside--fixed kt-page--loading");
  }
  componentWillUnmount() {
    document.body.classList.remove("kt-quick-panel--right kt-demo-panel--right kt-offcanvas-panel--right kt-header--fixed kt-header-mobile--fixed kt-subheader--enabled kt-subheader--fixed kt-subheader--solid kt-aside--enabled kt-aside--fixed kt-page--loading");
  }
  getRoutes = routes => {
    return routes.map((prop, key) => {
      if (prop.layout === "/auth") {
        return (
          <Route
            path={prop.layout + prop.path}
            component={prop.component}
            key={key}
          />
        );
      } else {
        return null;
      }
    });
  };
  render() {
    return (
      <>
      <div  style={{"background-image":" url(./assets/media//bg/bg-4.jpg)"}}>
        <Switch>{this.getRoutes(routes)}</Switch>
        </div>
       </>
    );
  }
}

export default Auth;
